import React, { useEffect, useState } from "react";

const API_BASE = "http://localhost:3001/api";
const ADMIN_PASS = "admin123"; // change later

function OpsDashboard() {
  const [auth, setAuth] = useState(false);
  const [pass, setPass] = useState("");
  const [tickets, setTickets] = useState([]);
  const [kpi, setKpi] = useState({});
  const [error, setError] = useState(null);

  const login = () => {
    if (pass === ADMIN_PASS) setAuth(true);
    else setError("❌ كلمة المرور غير صحيحة");
  };

  useEffect(() => {
    if (auth) {
      // جلب كل التذاكر
      fetch(`${API_BASE}/tickets-all`)
        .then((r) => r.json())
        .then((data) => setTickets(data.tickets || []))
        .catch(() => setError("⚠️ خطأ في جلب التذاكر"));

      // جلب الـ KPI
      fetch(`${API_BASE}/tickets-kpi`)
        .then((r) => r.json())
        .then(setKpi)
        .catch(() => setError("⚠️ خطأ في جلب مؤشرات الأداء"));
    }
  }, [auth]);

  if (!auth) {
    return (
      <div style={{ padding: 16 }}>
        <h2>Ops Dashboard</h2>
        <input
          type="password"
          placeholder="Password"
          onChange={(e) => setPass(e.target.value)}
        />
        <button onClick={login}>Login</button>
        {error && <p style={{ color: "red" }}>{error}</p>}
      </div>
    );
  }

  return (
    <div style={{ padding: 16, direction: "rtl" }}>
      <h2>لوحة الصيانة</h2>

      {/* KPI cards */}
      <div style={{ display: "flex", gap: 16, marginBottom: 16 }}>
        <div>📌 Open: {kpi.open}</div>
        <div>🚧 In Progress: {kpi.in_progress}</div>
        <div>✅ Completed: {kpi.completed}</div>
        <div>⏸️ On Hold: {kpi.on_hold}</div>
        <div>🔄 Referred: {kpi.referred}</div>
        <div>🚫 Cannot Access: {kpi.cannot_access}</div>
      </div>

      {/* CSV export */}
      <a
        href={`${API_BASE}/tickets-export`}
        target="_blank"
        rel="noreferrer"
        style={{ display: "block", marginBottom: 16 }}
      >
        ⬇️ تحميل CSV
      </a>

      {/* Tickets table */}
      <h3>جميع التذاكر</h3>
      {tickets.length === 0 ? (
        <p>لا توجد تذاكر مسجلة</p>
      ) : (
        <table
          border="1"
          cellPadding="6"
          style={{ borderCollapse: "collapse", width: "100%" }}
        >
          <thead>
            <tr>
              <th>الرقم</th>
              <th>العنوان</th>
              <th>الوصف</th>
              <th>الفئة</th>
              <th>الأولوية</th>
              <th>الموقع</th>
              <th>الجوال</th>
              <th>الحالة</th>
              <th>ملاحظات عامة</th>
            </tr>
          </thead>
          <tbody>
            {tickets.map((t) => (
              <tr key={t.id}>
                <td>{t.id}</td>
                <td>{t.title}</td>
                <td>{t.description}</td>
                <td>{t.category}</td>
                <td>{t.priority}</td>
                <td>{t.location}</td>
                <td>{t.contact}</td>
                <td>{t.status}</td>
                <td>{t.public_notes || "-"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default OpsDashboard;
